-- ----------------------------
--  Table structure for `bbs_picture`
-- ----------------------------
DROP TABLE IF EXISTS `bbs_picture`;
CREATE TABLE `bbs_picture` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `uid` int(10) DEFAULT NULL COMMENT '用户id',
  `related_id` varchar(20) DEFAULT NULL COMMENT '关联id',
  `type` tinyint(1) DEFAULT '0' COMMENT '0帖子，1评论',
  `category` tinyint(1) DEFAULT '0' COMMENT '0图片，1语音',
  `url` text COMMENT '资源路径',
  `examin` varchar(20) DEFAULT NULL COMMENT '后台审核人',
  `operating_time` int(11) DEFAULT NULL COMMENT '审核时间',
  `width` int(11) DEFAULT NULL,
  `height` int(11) DEFAULT NULL,
  `is_del` int(11) DEFAULT '0' COMMENT '状态；0正常；1主动删除；2后台删除',
  `created_at` int(11) DEFAULT NULL COMMENT '创建时间',
  `updated_at` int(11) DEFAULT NULL COMMENT '更新时间',
  `deleted_at` int(11) DEFAULT NULL COMMENT '删除时间',
  PRIMARY KEY (`id`),
  KEY `relatedid_type_is_del_index` (`related_id`,`type`,`is_del`)
) ENGINE=InnoDB AUTO_INCREMENT=2441 DEFAULT CHARSET=utf8mb4 COMMENT='图片音频表';

